import React, { useEffect, useState } from 'react'
import HouseList from '../components/HouseList'
import { addHouses } from '../redux/actions/HouseActions'
import { GetRequests } from '../util/ApiUtils'
import { useDispatch, useSelector } from 'react-redux'
import { Box } from '@chakra-ui/react'

function HomePage() {

  const dispatch = useDispatch();

  useEffect(() => {
      GetRequests("/api/characters/houses").then(res => {
      console.log("Response ", res);
      dispatch(addHouses(res.data))
      });

  }, [])

  const [familyTree, setFamilyTree] = useState({characterName: "#", spouse : [], children:[]});

  const houses = useSelector((state) => state.houseDetails.houses)
  console.log("House details  ", houses);

  return (
    <Box>
      <HouseList houses={houses} familyTree={familyTree} setFamilyTree={setFamilyTree} />
    </Box>
  )
}

export default HomePage
